import React from "react";

const SlideList = ({
  title,
  list,
  renderItem: RenderItem,
  hasMore,
  navigateMore,
}) => {
  return (
    <>
      {title && <h5>{title}</h5>}
      <div className={"slideList"}>
        <ul className={"listWrap"}>
          {list && list.map((data, index) => <RenderItem {...data} />)}
        </ul>
      </div>
    </>
  );
};

export default SlideList;
